import React, {Component} from 'react'
import Nav from '../components/organisms/nav'
import SignInForm from '../components/molecules/signinform'

export default class SignIn extends Component {
    constructor (props) {
        super(props)
    }

    render () {
        return (
            <div className='page'>
                <Nav />
                <SignInForm />
                <style jsx>{`
                    .page {
                        display: flex;
                    }
                `}</style>
            </div>
        )
    }
}
